import React, { Component } from 'react';

//welcome
class Welcome extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <div>
          Welcome to next.js!
      </div>
    )
  }
}

export default Welcome
